//http://msdn.microsoft.com/en-us/magazine/cc163413.aspx//http://stackoverflow.com/questions/2424327/prevent-asp-net-dopostback-from-jquery-submit-within-updatepanel//Adds an event handler to confirm unsaved changes when an asynchronous postback is initialised by an UpdatePanelfunction setConfirmAsyncPostBack() {    if (typeof (Sys.WebForms) === "undefined" || typeof (Sys.WebForms.PageRequestManager) === "undefined")        return;    var prm = Sys.WebForms.PageRequestManager.getInstance();    prm.add_initializeRequest(confirmAsyncPostBack);}//An event handler for asynchronous postbacks that confirms unsaved changes, cancelling the postback if they are not confirmed//Adds the confirmation to elements that have a css class of "warn"function confirmAsyncPostBack(sender, args) {    if (window.onbeforeunload != null && args.get_postBackElement().className == "warn" && !unloadConfirmed())        args.set_cancel(true);}//Displays a confirmation dialog that imitates the dialog displayed by onbeforeunloadfunction unloadConfirmed() {    var confirmed = confirm("Are you sure you want to navigate away from this page?

" + unloadMessage() + "

Press OK to continue or Cancel to stay on the current page.");    if (confirmed)        window.onbeforeunload = null;    return confirmed;}
